const block2 = (context, tags, suffix) => html`<${scopeTag("ui5-label", tags, suffix)} id="${ifDefined(context._id)}-label" class="ui5-busy-indicator-text">${ifDefined(context.text)}</${scopeTag("ui5-label", tags, suffix)}>`;
const block3 = (context, tags, suffix) => html`<span data-ui5-focus-redirect tabindex="0" @focusin="${context._redirectFocus}"></span>`;


export default block0;
